import React, { useState } from 'react'

function NewFile() {
    const [data,setData]=useState([2])
    const [ne,setNe]=useState([3])
    const [bool,setbool]=useState(false)
    const clickHandler=(()=>{
        setbool(!bool)
    })
    return (
      <div>
        {
          data.map((d,i)=>(
            <div>
            <h1>{i}Ali Abbas</h1>
            <h1 onClick={clickHandler}> {
          bool?
          <div>{i}</div>
        :false
}fghghnb</h1>
            </div>
          ))
}     
      </div>
    );
  }
  
  export default NewFile;
